import { Component } from "react";

class R071_Onkey extends Component{
    Onkey(event, e) {
        var val = e.tatget.value;
        console.log("event: "+event+", value: "+val);
    }

    render() {
        return(
            <>
                <div onMouseOut={e => this.MouseOut("div")}>
                    <h3>R071_Onkey</h3>
                </div>

                <input type="text" onMouseOut={e => this.MouseOut("input")}/>
                <select onMouseOut={e => this.MouseOut("select")}>
                    <option value="resct">resct</option>
                    <option value="200">200</option>
                </select>
            </>
        )
    }
}

export default R071_Onkey;
